            DiaChi: $('#DiaChi').val(),
        };
        $.ajax({
            url: ""/Profile/Update"",
            data: JSON.stringify(admin),
            type: ""POST"",
            dataType: ""JSON"",
            contentType: ""application/json;charset=utf-8"",
            success: function (result) {
                loadData();
                $(""#profileModal"").removeClass(""open"");
                $('#TenQuanLy').val("""");
                $('#SoDienThoai').val("""");
                $('#Email').val("""");
                $('#DiaChi').val("""");
            }
        });
    }

</script>");
